import React from 'react'

import flower5 from '../Images/flower5.svg'
import cactus from '../Images/cactus.svg'

import './contact.css'

function Contact() {
  return (
    <section className="contact" id="contact">
      <img className="flower-5" src={flower5} />
    </section>
  )
}

export default Contact
